# INCLUDES
[include mainsail.cfg]
[include macros.cfg]
[include timelapse.cfg]
[include KAMP_Settings.cfg]
[include options/fans/fans.cfg]
[include options/sensors/sensors.cfg]
[include options/heaters/heaters.cfg]
[include options/thermistor/thermistor.cfg]
[include options/probe/beacon.cfg]
[include options/led/hotend.cfg]
[include options/led/enclosure.cfg]

# MCU CONFIGURATION
[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32h723xx_090020000251313239393734-if00
restart_method: command

[mcu toolhead]
serial: /dev/serial/by-id/usb-Klipper_rp2040_4E363334320EACCE-if00
restart_method: command

# PRINTER CONFIGURATION
[printer]
kinematics: corexy
max_velocity: 500
max_accel: 7200
minimum_cruise_ratio: 0.5
max_z_velocity: 20
max_z_accel: 500
square_corner_velocity: 5.0

# X STEPPER
[stepper_x]
step_pin: PE2
dir_pin: PE3
enable_pin: !PD4
rotation_distance: 40.59287
microsteps: 64
full_steps_per_rotation: 200
endstop_pin: tmc2209_stepper_x:virtual_endstop
position_min: -20
position_endstop: 359
position_max: 375
homing_speed: 30
homing_retract_dist: 0
homing_positive_dir: true

[tmc2209 stepper_x]
uart_pin: PE1
interpolate: false
run_current: 1.3
sense_resistor: 0.150
stealthchop_threshold: 999999
driver_sgthrs: 85
diag_pin: PG14
driver_TBL: 1
driver_TOFF: 3
driver_HSTRT: 7
driver_HEND: 5

# Y STEPPER
[stepper_y]
step_pin: PE6
dir_pin: PA14
enable_pin: !PE0
rotation_distance: 40.71132
microsteps: 64
full_steps_per_rotation: 200
endstop_pin: tmc2209_stepper_y:virtual_endstop
position_min: -3
position_endstop: 367
position_max: 382
homing_speed: 30
homing_retract_dist: 0
homing_positive_dir: true

[tmc2209 stepper_y]
uart_pin: PD3
interpolate: false
run_current: 1.3
sense_resistor: 0.150
stealthchop_threshold: 999999
driver_sgthrs: 85
diag_pin: PG15
driver_TBL: 1
driver_TOFF: 3
driver_HSTRT: 7
driver_HEND: 5

# Z STEPPERS
[stepper_z]
step_pin: PF11
dir_pin: !PG3
enable_pin: !PG5
rotation_distance: 40
gear_ratio: 80:12
microsteps: 32
endstop_pin: probe:z_virtual_endstop
position_max: 347
position_min: -5
homing_speed: 15.0
homing_retract_dist: 0
homing_retract_speed: 15.0
second_homing_speed: 10.0

[tmc2209 stepper_z]
uart_pin: PC6
interpolate: false
run_current: 0.55
sense_resistor: 0.110
stealthchop_threshold: 999999

[stepper_z1]
step_pin: PG0
dir_pin: PG1
enable_pin: !PF15
rotation_distance: 40
gear_ratio: 80:12
microsteps: 32

[tmc2209 stepper_z1]
uart_pin: PD11
interpolate: false
run_current: 0.55
sense_resistor: 0.110
stealthchop_threshold: 999999

[stepper_z2]
step_pin: PG4
dir_pin: !PC1
enable_pin: !PA2
rotation_distance: 40
gear_ratio: 80:12
microsteps: 32

[tmc2209 stepper_z2]
uart_pin: PC7
interpolate: false
run_current: 0.55
sense_resistor: 0.110
stealthchop_threshold: 999999

[stepper_z3]
step_pin: PF13
dir_pin: PF12
enable_pin: !PF14
rotation_distance: 40
gear_ratio: 80:12
microsteps: 32

[tmc2209 stepper_z3]
uart_pin: PC4
interpolate: false
run_current: 0.55
sense_resistor: 0.110
stealthchop_threshold: 999999

# EXTRUDER
[extruder]
step_pin: toolhead:gpio23
dir_pin: !toolhead:gpio24
enable_pin: !toolhead:gpio25
rotation_distance: 4.637
microsteps: 32
full_steps_per_rotation: 200
nozzle_diameter: 0.400
filament_diameter: 1.75
max_extrude_only_distance: 500
max_extrude_only_velocity: 120
heater_pin: toolhead:gpio9
sensor_type: PT1000
pullup_resistor: 2200
sensor_pin: toolhead:gpio29
min_temp: 5
max_temp: 305
max_power: 1.0
min_extrude_temp: 150
control: pid
pid_kp: 33.064
pid_ki: 11.021
pid_kd: 24.799
pressure_advance: 0.025
pressure_advance_smooth_time: 0.03
max_extrude_cross_section: 10

[tmc2209 extruder]
uart_pin: toolhead:gpio1
interpolate: false
run_current: 0.8
sense_resistor: 0.100
driver_TBL: 1
driver_TOFF: 3
driver_HSTRT: 7
driver_HEND: 8

[firmware_retraction]
retract_length: 0
retract_speed: 20
unretract_extra_length: 0
unretract_speed: 10

# MOTION CONFIGURATION
[gcode_arcs]
resolution: 1.0

[input_shaper]
damping_ratio_x: 0.047
damping_ratio_y: 0.088
shaper_type_x: zv
shaper_freq_x: 61.8
shaper_type_y: zv
shaper_freq_y: 43

[skew_correction]

[shaketune]
result_folder: ~/printer_data/config/ShakeTune_results
number_of_results_to_keep: 10
keep_raw_data: False
measurements_chunk_size: 5
max_freq: 200
dpi: 300

# SYSTEM
[idle_timeout]
gcode: _IDLE_TIMEOUT
timeout: 600

[pause_resume]

[exclude_object]

[save_variables]
filename: ~/printer_data/config/saved_variables.cfg

